씁... 미미님은 성하 러프 처음 그려주셨을 때 사랑의 증거 아니냐고 해주셨는데 난... 살펴보니까 이때인 거 같아... 아니 왜 혼자 여행 잘 가서 귀엽고 몽글하게 노는 애 보고 마음이 아린 건데... 관캐 테스트 셀프로 한 거 아니냐고... 덕캐면 그냥 귀엽다 ㅎㅎ 하고 말 건데 과몰입함
