아... 미미님 큰일낫어요... 이문이가 이제야 원하던 만큼 마음대로 발길 닿는 대로 돌아다닐 수 있어서 맴이 너무 아릿하고... 동시에 낙서까지 할 만큼 그리던 곳에서 셀카 찍는 게 귀엽구 깜찍해서 맴이 너므 펄떡입니다 흑흑ㅠㅠ 우리 이문이 맨날천날 진심으로 웃을 수 있음 조켓다ㅠㅠ소원이야ㅠ
